    [Parameter]
    public int Id { get; set; }

    private bool _continue;
    private SaveMemorabiliaItemViewModel _viewModel = new SaveMemorabiliaItemViewModel();

    protected async Task HandleValidSubmit()
    {
        var userId = await _localStorage.GetAsync<int>("UserId");

        if (userId.Value == 0)
            _navigation.NavigateTo("Login");

        _viewModel.UserId = userId.Value;

        var command = new SaveMemorabiliaItem.Command(_viewModel);

        await _commandRouter.Send(command).ConfigureAwait(false);

        var itemTypeName = Domain.Constants.ItemType.Find(_viewModel.ItemTypeId).Name;
        var url = _continue ? $"Memorabilia/{itemTypeName}/Edit/{command.Id}" : "Memorabilia/UnsignedItems";

        _navigation.NavigateTo(url);

        _toastService.ShowSuccess($"{itemTypeName} was saved successfully!", _viewModel.PageTitle);
    }

    protected override async Task OnInitializedAsync()
    {
        var userId = await _localStorage.GetAsync<int>("UserId");

        if (userId.Value == 0)
            _navigation.NavigateTo("Login");

        var query = new GetMemorabiliaItem.Query(Id);

        _viewModel = new SaveMemorabiliaItemViewModel(await _queryRouter.Send(query).ConfigureAwait(false));
    }

